BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" (
    "id" SERIAL PRIMARY KEY, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" (
    "id" SERIAL PRIMARY KEY,"name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_content_type" (
    "id" SERIAL PRIMARY KEY,"app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" (
    "id" SERIAL PRIMARY KEY, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" (
    "id" SERIAL PRIMARY KEY,"group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user" (
    "id" SERIAL PRIMARY KEY, "password" varchar(128) NOT NULL, "last_login" timestamp NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" timestamp NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user_groups" (
    "id" SERIAL PRIMARY KEY,"user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" (
    "id" SERIAL PRIMARY KEY,"user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" (
    "id" SERIAL PRIMARY KEY, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint  NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "catalog_idioma" (
    "id" SERIAL PRIMARY KEY, "idioma" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "catalog_images" (
    "id" SERIAL PRIMARY KEY,"image" text NOT NULL);
CREATE TABLE IF NOT EXISTS "catalog_moneda" (
    "id" SERIAL PRIMARY KEY, "moneda" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "catalog_type" (
    "id" SERIAL PRIMARY KEY,"type" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "catalog_producto" (
    "id" SERIAL PRIMARY KEY,"nombre" varchar(100) NOT NULL, "descripcion" text NOT NULL, "precio" decimal NOT NULL, "url" text NOT NULL, "set" varchar(50) NOT NULL, "color" varchar(250) NOT NULL, "idioma_id" bigint NOT NULL REFERENCES "catalog_idioma" ("id") DEFERRABLE INITIALLY DEFERRED, "image_id" bigint NOT NULL REFERENCES "catalog_images" ("id") DEFERRABLE INITIALLY DEFERRED, "moneda_id" bigint NOT NULL REFERENCES "catalog_moneda" ("id") DEFERRABLE INITIALLY DEFERRED, "type_id" bigint NOT NULL REFERENCES "catalog_type" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" (
    "session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "catalog_card" (
    "id" SERIAL PRIMARY KEY, "name" varchar(100) NOT NULL, "price" decimal NOT NULL, "url" text NOT NULL, "moneda_id" bigint NOT NULL REFERENCES "catalog_moneda" ("id") DEFERRABLE INITIALLY DEFERRED, "carid" varchar(20) NOT NULL);
COMMIT;
